import React,{useEffect} from "react";
import movieApi from "../../common/apis/movieApi"
import {APIKey} from "../../common/apis/movieApiKey"

const Tree = () => {
    useEffect(()=>{
        const title="apple";
        const fetchTitle = async () =>{
            const response =  await movieApi.get(`?key=${APIKey}&q=${title}&image_type=photos`)
            .catch((err) =>{
                console.log("Err :",err);
            });
        };
    });
    return (
        <div className="container">

        </div>
    );
};

export default Tree;
